eH211:"Давайте",homeH212:"знайомитись",homeH213:"ближче",homeP1:"Привіт, я Вадім Червоняк, Full-stack розробник з України. Моя експертиза включає HTML, CSS, JavaScript, Vue, React, Node.js, різні бази даних, хмарні технології та інтеграцію з різними API, що дозволяє мені надавати комплексні рішення для веб-розробки.",homeB2:"Дізнатись Про Мене Більше",homeH22:"Огляд Моїх Проєктів",homeB3:"ВІДКРИТИ БІЛЬШЕ",homeH23:"Технології, які я люблю використовувати, і в котрих продовжую поглиблюватись",aboutH21:"Про Мене",aboutT1:"Коротко Про Мою Особистість",aboutH221:"Моя місія —",aboutH222:"робити",aboutH223:"розробку",aboutH224:"простішою.",aboutT21:"Як окремі особистості, ми всі народжуємося розробниками, постійно формуючи наші нейронні мережі протягом життя. Деякі з нас, включаючи мене, обрали шлях перетворення цієї пристрасті до розвитку на успішну кар’єру у веб-розробці. Для мене це не просто робота, а покликання, яке дозволяє виражати творчість і робити значущий внесок через технології.",aboutT22:"У кожного з нас є своя унікальна історія, яку хочеться розповісти, і мовою технологій ми пишемо свої автобіографії, оживляючи ідеї на цифровому полотні. Я глибоко відданий створенню зручних для користувачів веб-застосунків і постійно вдосконалюю свої навички, щоб залишатися попереду в цій постійно змінюваній індустрії.",worksH2:"Мої Роботи",worksT1:"Огляд Мої Робіт",worksMore:"завантажити ще",worksDetails:"Переглянути деталі про",projectH21:"Деталі Проєкту",projectT1:"Інформація Про Проєкт",projectP1:"Тех. область",projectP2:"Техстек",projectP3:"Код",projectP4:"Демо",projectP5:"Бібліотеки",projectP5_default:"Цей проєкт не використовує жодних зовнішніх бібліотек і спирається виключно на стандартні вбудовані можливості обробки HTML, CSS та JavaScript у сучасних браузерах.",projectP6:"Опис",projectP6_default:"Схоже, що опис не додано, тому припустімо, що цей проєкт є самодостатнім і не потребує явних описових слів.",projectPrev:"ПОПЕРЕДНЯ РОБОТА",projectNext:"НАСТУПНА РОБОТА",pr